import React from 'react';

function DisplayData(){
    <section className='display-item'>
    <div className="wrapper">
      <ul>
        {this.state.elements.map((item) => {
          return (
            <li key={item.id}>
              <h3>{item.name}</h3>
              <p>brought by: {item.age}</p>
            </li>
          )
        })}
      </ul>
    </div>
  </section>    
}

export default DisplayData;
